import React, { useState } from 'react'

import "./Domains.scss"

const Domains = ({img, alt, title}) => {
    const [modalIsOpen, setIsModalOpen] = useS
    return (
        <div class="main-item">
            <img class="img" src={img} alt={alt} />
            <h1>{title}</h1>
        </div>
    )
}

export default Domains
